import React, {Component} from 'react';
import './Hello.css';

class Hello extends Component {
	render() {
		return(
			<div class='f1 tc'>
				<h1> Hello World </h1>
				<p> Welcome To React! </p>
			</div>
		);
	}
}

export default Hello;
